const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-side-text">
          <h2>Now it’s your turn</h2>
          <p>Let's start working together. You can drop me a mail, send a message on Facebook, or fill the form (please double check your email). I’ll get back to you within 24 hours.MY EMAIL: yakutmuder9@gmail.com</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
